String.prototype.replaceAll = function(reallyDo, replaceWith, ignoreCase) {  
    if(!RegExp.prototype.isPrototypeOf(reallyDo)){
        return this.replace(new RegExp(reallyDo,(ignoreCase ? "gi": "g")), replaceWith);
    }else{
        return this.replace(reallyDo, replaceWith);
    }
}

String.prototype.toUnicode = function(){
	var str = this;
	str = escape(this).toLocaleLowerCase().replace(/%u/gi,'\\u');
	return str;
}
String.prototype.toGB2312 = function(){
	var str = this;
	str = unescape(str.replace(/\\u/gi,'%u'));
	return str;
}
String.prototype.replaceEmoji = function(){
	var emojireg = this;
	var ranges = [
	    '\ud83c[\udf00-\udfff]',
	    '\ud83d[\udc00-\ude4f]',
	    '\ud83d[\ude80-\udeff]'
	];
	var reg = new RegExp(ranges.join('|'),'g');
	return emojireg.replace(reg,'');
}
