function newMap(){
	var map = {};
	var container = {};
	map.put = function(key,value){
		container[key]=value;
	};
	map.get = function(key){
		return container[key];
	};
	map.contains = function(key){
		return key in container;
	};
	map.remove = function(key){
		delete container[key];
	};
	map.keys = function(){
		var keyset = new Array();
		var count = 0;
		for(var key in container){
			keyset[count] = key;
			count++;
		}
		return keyset;
	};
	return map;
}
function testMap(){
	var map = newMap();
	map.put("a", "aaa");
	map.put("b","bbb");
	map.put("cc","cccc");
	map.put("c","ccc");
	map.remove("cc");
	var array = map.keys();
	for(var i in array) {
		alert("key:(" + array[i] +") <br>value: ("+map.get(array[i])+") <br>");
	}
}
