var realSheBeiWidth = 0;
var realBili = 0;
function getRealBili(){
    if(realSheBeiWidth==0){
        realSheBeiWidth=$('body').width();
    }
    if(realBili==0){
        realBili = realSheBeiWidth/400;
    }
    return realBili;
}
function getBiliZ(zhi){
    var bili = getRealBili();
    return Math.round(zhi*bili);
}
function domPositionUtil(container,dom,imgWidth,imgHeight,topAdd,leftAdd,topFlag,fullType){
    imgWidth = getBiliZ(imgWidth);
    imgHeight = getBiliZ(imgHeight);
    if(!topAdd) topAdd = 0;
    if(!leftAdd) leftAdd = 0;
    topAdd = getBiliZ(topAdd);
    leftAdd = getBiliZ(leftAdd);
    var screenWidth = $(container).width();
    var screenHeight = $(container).height();
    var left = Math.round((screenWidth-imgWidth)/2);
    var top = Math.round((screenHeight-imgHeight)/2);
    var topLast = top + topAdd;
    var leftLast = left + leftAdd;
    if (topFlag == 0) {//
        topLast = top + topAdd;
        leftLast = left + leftAdd;
    }
    if (topFlag == 1) {//
        topLast = topAdd;
        leftLast = leftAdd;
    }
    if (topFlag == 2) {//
        topLast = topAdd;
        leftLast = left + leftAdd;
    }
    if (topFlag == 3) {//
        topLast = topAdd;
        leftLast = realSheBeiWidth - leftAdd - imgWidth;
    }
    if (topFlag == 4) {//
        topLast = top;
        leftLast = screenWidth - leftAdd - imgWidth;
    }
    if (topFlag == 5) {//
        topLast = screenHeight - topAdd - imgHeight;
        leftLast = realSheBeiWidth - leftAdd - imgWidth;
    }
    if (topFlag == 6) {//
        topLast = screenHeight - topAdd - imgHeight;
        leftLast = left + leftAdd;
    }
    if (topFlag == 7) {//
        topLast = screenHeight - topAdd - imgHeight;
        leftLast = leftAdd;
    }
    if (topFlag == 8) {//
        topLast = top + topAdd;
        leftLast = leftAdd;
    }
    var doms = $(container).find(dom);
    doms.css("position", "fixed");
    if(fullType == 1) {
        doms.css("width", "100%");
        doms.css("height", "100%");
    }else if(fullType == 2) {
        doms.css("width", "100%");
        doms.css("height", imgHeight + "px");
    }else if(fullType == 3) {
        doms.css("width", imgWidth + "px");
        doms.css("height", "100%");
    }else{
        doms.css("width", imgWidth + "px");
        doms.css("height", imgHeight + "px");
    }if(container == 'body') {
        doms.css("top", topLast);
        doms.css("left", leftLast);
    }else{
        doms.css("margin-top", topLast);
        doms.css("margin-left", leftLast);
    }
}
function fontCenterUtil(container, dom, imgWidth, imgHeight, topAdd, leftAdd, topFlag) {
    domPositionUtil(container, dom, imgWidth, imgHeight, topAdd, leftAdd, topFlag);
    var realpx = $(container).find(dom).css("fontSize");
    if(realpx != null && realpx != ''){
        var realpxNumber = getBiliZ(parseInt(realpx.replace("px", "")));
        $(container).find(dom).css("fontSize", realpxNumber + "px");
        $(container).find(dom).find("td").css("fontSize",realpxNumber + "px");
    }
    $(container).find(dom).find("a").each(function() {
        var realpx2 = $(this).css("fontSize");
        if (realpx2 != null && realpx2 != ''){
            var realpxNumber2 = getBiliZ(parseInt(realpx2.replace("px", "")));
            $(this).css("fontSize", realpxNumber2 + "px");
        }
    });
    $(container).find(dom).find("img").each(function(){
        $(this).width(getBiliZ($(this).width()));
        $(this).height(getBiliZ($(this).height()));
    });
}
